import Link from 'next/link';

const UsersList = props => (
<div>
   {
       props.users.map(user=>(
           <div>
        <Link href={`/User?name=${user.username}`} as={`/user/${user.username}`}>
            <a className="username">{user.name}</a>
        </Link>
        </div>
       ))
   }

<style jsx>{`
    .username2{
        backround:black;
        color:white
    }
`}</style>
</div>
)
export default UsersList;
